import React from "react";

function ListItem(props) {
  const nameList = {
    name: {
      title: "mr",
      first: "brad",
      last: "gibson",
    },
    location: {
      street: "9278 new road",
    },
    email: "brad.gibson@example.com",
    dob: {
      date: "1993-07-20T09:44:18.674Z",
      age: 26,
    },
  };
  return (
    <p 
    name = "Sami"
    city = "Colombo"
    email = "samiudakara@gmail.com"
    birthday = ""
    avatar = ""
    >
      {props.name} - {props.subject}
    </p>
  );
}

export default ListItem;
